  const [posts, setPosts] = useState([]);
  // const { search } = useLocation();

  useEffect(() => {
    const fetchPosts = async () => {
       const res = await axios.get("/posts" /* + search*/);
      setPosts(res.data);
      console.log(res);
    };
    fetchPosts();
  }, /*[search]*/);
  return (
    <>
      <Header />
      <div className="home">
        <Posts posts={posts}/>
        <Sidebar />
      </div>
    </>
  );
}
